import axios from "axios";
import React from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

function Login()
{
    
const [loginemail, setloginemail] = useState('');
const [loginpass, setloginpass] = useState('');

const navigate = useNavigate();

const login = () =>
{
    axios.post('http://localhost:4000/login',{loginemail,loginpass}).then(
    result => {console.log(result)
    
    
    if(result.data ==='userdata')
    {
        navigate('/home');
    }
    else if(result.data === 'admindata')
    {
        navigate('/dashboard');
    }
    }
    
)
}
    return(
        <div>

<div class="container-fluid p-0 nav-bar">
        <nav class="navbar navbar-expand-lg bg-none navbar-dark py-3">
            <Link to="/" class="navbar-brand">
                <h1 class="m-0 display-4 font-weight-bold text-uppercase text-white">Gymnast</h1>
            </Link>
            <button type="button" class="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse justify-content-between" id="navbarCollapse">
                <div class="navbar-nav ml-auto p-4 bg-secondary">
                    <Link to="/home" class="nav-item nav-link">Home</Link>
                    <Link to="/about" class="nav-item nav-link">About Us</Link>
                    <Link to="/class" class="nav-item nav-link">Classes</Link>
                    <Link to="/workout" class="nav-item nav-link">Workouts</Link>
                    <Link to="/blog" class="nav-item nav-link">Blog</Link>
                    <Link to="/diet" class="nav-item nav-link">Diet</Link>
                    <Link to="/contact" class="nav-item nav-link">Contact</Link>
                    <Link to="/signup" class="nav-item nav-link">Signup</Link>
                    <Link to="/login" class="nav-item nav-link">Login</Link>
                </div>
            </div>
        </nav>
    </div>
   
    <div class="container-fluid page-header mb-5">
        <div class="d-flex flex-column align-items-center justify-content-center pt-0 pt-lg-5" >
            <h4 class="display-4 mb-3 mt-0 mt-lg-5 text-white text-uppercase font-weight-bold">Login In </h4>
            <div class="d-inline-flex">
                <p class="m-0 text-white"><a class="text-white" href="">Home</a></p>
                <p class="m-0 text-white px-2">/</p>
                <p class="m-0 text-white">Login In  </p>
            </div>
        </div>
    </div>
   
  <div className="container">
 
    <input type="email" placeholder="Email"  onChange={(e)=>setloginemail(e.target.value)} className="form-control w-50 mt-3"/>
    <input type="password" placeholder="Password" onChange={(e)=>setloginpass(e.target.value)} className="form-control w-50 mt-3"/>
   

 <button onClick={login} className="btn btn-danger mt-3">Login</button>
  </div>
  
    <a href="#" class="btn btn-outline-primary back-to-top"><i class="fa fa-angle-double-up"></i></a>


        </div>
    )
}

export default Login;
